      out.write("    var theta = lon1 - lon2;\r\n");
      out.write("    var radTheta = Math.PI * theta / 180;\r\n");
      out.write("    var dist = Math.sin(radLat1) * Math.sin(radLat2) + Math.cos(radLat1) * Math.cos(radLat2) * Math.cos(radTheta);\r\n");
      out.write("    if (dist > 1)\r\n");
